import { Component } from '@angular/core';

@Component({
  selector: 'app-admission',
  templateUrl: './admission.component.html',
  styleUrls: ['./admission.component.css']
})
export class AdmissionComponent {
  name: String
  register: String,
  genre: String,
  photo: String,
  dateN: Date,
  adresse: String,
  role: String,
  father:String,
  profession: String,
  nationalid: String,
  education: String,
  mobile: String,
  email: String,

  constructor(name){}
}
